@bootstrap
def dfs(cur, csum, res):
    csum = csum + cur
    res = res + 1

    if csum >= LARGE:
        return
    if (cur, csum) in visited:
        return
    
    visited.add((cur, csum))
    
    result[csum] = max(result[csum], res)

    for i in range(2,LARGE):
        if i*cur+csum >= LARGE:
            break
        dfs(i*cur, csum, res)


